mapper.select:

select 

from public.在庫データ
where 倉庫コード = #{倉庫コード,jdbcType=VARCHAR}
  and 商品コード = #{商品コード,jdbcType=VARCHAR}
  and ロット番号 = #{ロット番号,jdbcType=VARCHAR}
  and 在庫区分 = #{在庫区分,jdbcType=VARCHAR}
  and 良品区分 = #{良品区分,jdbcType=VARCHAR}

mapper.delete:

delete from public.在庫データ
where 倉庫コード = #{倉庫コード,jdbcType=VARCHAR}
  and 商品コード = #{商品コード,jdbcType=VARCHAR}
  and ロット番号 = #{ロット番号,jdbcType=VARCHAR}
  and 在庫区分 = #{在庫区分,jdbcType=VARCHAR}
  and 良品区分 = #{良品区分,jdbcType=VARCHAR}

mapper.insert:

insert into public.在庫データ (倉庫コード, 商品コード, ロット番号, 
  在庫区分, 良品区分, 実在庫数, 有効在庫数, 
  最終出荷日, 作成日時, 作成者名, 
  更新日時, 更新者名, version
  )
values (#{倉庫コード,jdbcType=VARCHAR}, #{商品コード,jdbcType=VARCHAR}, #{ロット番号,jdbcType=VARCHAR}, 
  #{在庫区分,jdbcType=VARCHAR}, #{良品区分,jdbcType=VARCHAR}, #{実在庫数,jdbcType=INTEGER}, #{有効在庫数,jdbcType=INTEGER}, 
  #{最終出荷日,jdbcType=TIMESTAMP}, #{作成日時,jdbcType=TIMESTAMP}, #{作成者名,jdbcType=VARCHAR}, 
  #{更新日時,jdbcType=TIMESTAMP}, #{更新者名,jdbcType=VARCHAR}, #{version,jdbcType=INTEGER}
  )

mapper.update:

update public.在庫データ


    実在庫数 = #{実在庫数,jdbcType=INTEGER},


    有効在庫数 = #{有効在庫数,jdbcType=INTEGER},


    最終出荷日 = #{最終出荷日,jdbcType=TIMESTAMP},


    作成日時 = #{作成日時,jdbcType=TIMESTAMP},


    作成者名 = #{作成者名,jdbcType=VARCHAR},


    更新日時 = #{更新日時,jdbcType=TIMESTAMP},


    更新者名 = #{更新者名,jdbcType=VARCHAR},


    version = #{version,jdbcType=INTEGER},


where 倉庫コード = #{倉庫コード,jdbcType=VARCHAR}
  and 商品コード = #{商品コード,jdbcType=VARCHAR}
  and ロット番号 = #{ロット番号,jdbcType=VARCHAR}
  and 在庫区分 = #{在庫区分,jdbcType=VARCHAR}
  and 良品区分 = #{良品区分,jdbcType=VARCHAR}


